import React from "react";
import ColorSliderProvider, {
  HueSlider,
  SaturationSlider,
} from "material-ui-color-sliders";

export default () => (
  <ColorSliderProvider>
    <HueSlider style={{ margin: "128px 32px", width: "calc(100% - 256px)" }} />
    <SaturationSlider
      style={{ margin: "128px 32px", width: "calc(100% - 256px)" }}
    />
  </ColorSliderProvider>
);
